def handleArguments():
    # check if "b=" is in one of the arguments
    blackPlayer = None
    whitePlayer = None

    custom_ply = 4
    # here we loop once to find the ply if it exists.
    for i in sys.argv:
        if "ply=" in i:
            custom_ply = int(i.replace("ply=", ""))

            if custom_ply >= 1:
                ply = custom_ply

    playerTypes = generatePlayerOptions(custom_ply)
    # here we loop to generate agents.
    for i in sys.argv:
        if "b=" in i:
            # black player detected
            blackPlayer = loadPlayerClass(i, playerTypes)
        if "w=" in i:
            # white player detected
            whitePlayer = loadPlayerClass(i, playerTypes)
            
    # check if they're still null values.
    if blackPlayer == None:
        blackPlayer = loadPlayer({'colour':"Black"})
    if whitePlayer == None:
        whitePlayer = loadPlayer({'colour':"White"})

    return blackPlayer, whitePlayer

def loadPlayer(options={}):
    print("Who will be the", options['colour'], "player?")
    if options['colour'] == "Black":
        print("Note that Black plays first.")
    if options['colour'] == "White":
        print("White player plays second.")
    print()

    playerTypes = generatePlayerOptions()

    player = None
    while player == None:
        for i in playerTypes.keys():
            print(str(i)+ "   \t", playerTypes[i]['description'])
        
        print()
        resp = input(str(options['colour']) + " Player:").lower()
        if resp in playerTypes.keys():
            player = resp
        else:
            print(resp, "is not a recognised agent. Try again.")

    player = player.lower()

    playerClass = playerTypes[player]['class']

    if player == "slowpoke":
        playerClass = handleSlowpokeOptions()

    # load the agent who will play this.
    print()
    return (agent.Agent(playerClass), player)

def handleSlowpokeOptions():
    # handle slowpoke operations
    chosenPly = False
    plyDepth = 1
    while not chosenPly:
        print("What ply would you like to run Slowpoke in?")
        print("Options: 1-6")
        plyDepth = input("Ply:")
        plyDepth = int(plyDepth)
        if plyDepth > 0 and plyDepth < 10:
            chosenPly = True
    chosenWeights = False

    lo = al.agentLoader()
    system = lo.loadAgentUI()
    agentID = lo.loadSpecificAgent(system)
    # load weights
    botWeights = np.array(lo.loadAgentWeights(system, agentID))
    return  genSlowpokeClass(plyCount=plyDepth, weights=botWeights)

def initiateAgents():
    """
    Loads white and black agents so we can play the game.
    """
    blackAgent = loadPlayer({'colour':"Black"})
    whiteAgent = loadPlayer({'colour':"White"})
    return (blackAgent, whiteAgent)

